import React from 'react';
import Introduction from './components/Introduction';
import ServicePage from './pages/ServicePage';
import ClientTestimonial from './components/ClientTestimonial';



function App() {
  return (
    <div className="App">
      <nav className="bg-blue-500 p-4">
        <ul className="flex justify-around">
          <li><a href="#introduction" className="text-white">Introduction</a></li>
          <li><a href="#services" className="text-white">Services</a></li>
          <li><a href="#HighlitedProduct" className="text-white">Products</a></li>
          <li><a href="#testimonials" className="text-white">Testimonials</a></li>
          <li><a href="#contact" className="text-white">Contact</a></li>
        </ul>
      </nav>

      <section id="introduction" className="p-4">
        <Introduction />
      </section>

      <section id="services" className="p-4">
        <ServicePage />
      </section>
      <section id="services" className="p-4">
        <ClientTestimonial />
      </section>

      

      
        
 
    </div>
  );
}

export default App;
